const LetterAnimation = ({
  letterClass = "LetterAnimation",
  strArray,
  idx = 1,
}) => {
  return (
    <span>
      {strArray.map((char, i) => (
        <span key={char + i} className={`${letterClass} _${i + idx}`}>
          {char}
        </span>
      ))}
    </span>
  );
};

export default LetterAnimation;
